from collections import defaultdict

class Solution:
    def minNumberOfFrogs(self, croakOfFrogs: str) -> int:
        croak = "croak"
        arrFrog = defaultdict(list)
        frogs = 0
        endingFrog = 0
        beginningFrog = 0
        for c in croakOfFrogs:
            if c == 'c':
                #create new object
                arrFrog['c'].append('c')
                beginningFrog += 1
            else:
                idx = croak.find(c)
                substr = croak[0:idx]
                if len(arrFrog[substr]) == 0: #invalid
                    return -1
                next = arrFrog[substr].pop() + c
                arrFrog[next].append(next)

            if c == 'k': #last one and valid
                endingFrog += 1
            frogs = max(frogs, beginningFrog - endingFrog)

        if beginningFrog != endingFrog: #not valid
            return -1

        return frogs

test = Solution()
print(test.minNumberOfFrogs("croakcroak")) #1
print(test.minNumberOfFrogs("crcoakroak")) #2
print(test.minNumberOfFrogs("croakcrook")) #-1
print(test.minNumberOfFrogs("croakcroa")) #-1
print(test.minNumberOfFrogs("crocrocroakakakcroak")) #3
print(test.minNumberOfFrogs("crocrocroakakcakcroakroak")) #3
print(test.minNumberOfFrogs(""))
